/**
 * personal center router page
 */
import React from 'react'
import { Result, List, WhiteSpace, Button } from 'antd-mobile'
import { connect } from 'react-redux'

const Item = List.Item
const Brief = Item.Brief
class PersonalCenter extends React.Component {
    render() {
        const { username, type, header, company, position, salary } = this.props.user;
        return (
            <div>
                <Result
                    img={<img src={require(`../../assets/img/avatar1.png`)} style={{ width: 50 }}
                        alt="header" />}
                    title='张三'
                    message='IBM'
                />
                <List renderHeader={() => '相关信息'}>
                    <Item multipleLine>
                        <Brief>职位: 前端工程师</Brief>
                        <Brief>简介: React/Vue/jQuery</Brief>
                        <Brief>薪资: 20k</Brief>
                    </Item>
                </List>
                <WhiteSpace />
                <List>
                    <Button type='warning'>退出登录</Button>
                </List>
            </div>
        )
    }
}
export default connect(
    state => ({ user: state.user1 }),
    {}
)(PersonalCenter)
